import './HeaderNav.css';

const HeaderNav = ({setLandingModal}) => {

  return (
    <nav className="navbar">
        <div>
            <span className="navbar-brand">Welcome user!</span>

        </div>



        <div className="list">
            <label className="toggler" htmlFor="toggle"> 
                <span className="material-icons"> menu</span>
            </label>

            <input type="checkbox" name="toggle" id="toggle" />

            <div className="nav-menu">    
                {/* <ul>
                  <li>
                    <Link to="/">Home</Link>
                  </li>
                  <li>
                    <Link to="/learn">Learn</Link>
                  </li>
                  <li>
                    <Link to="/blog">Blog</Link>
                  </li>
                  <li>
                    <Link to="/" onClick={()=>{
                                              localStorage.removeItem('W2M-JWT-Token');
                                              setLandingModal(true)
                                              }}>Logout</Link>
                  </li>
                </ul> */}
                <Link to='/'><h2>Home</h2></Link>
                <nav>
      <ul>
        <NavLink to='/' style={({isActive}) => {
          return {
            color: isActive && 'red'
          }
        }}>
          <li>Home</li>
        </NavLink>
        <NavLink to='/blog' style={({isActive}) => {
          return {
            color: isActive && 'red'
          }
        }}>
          <li>Photos</li>
        </NavLink>
        <NavLink to='/learn' style={({isActive}) => {
          return {
            color: isActive && 'red'
          }
        }}>
          <li>About</li>
        </NavLink>
        <NavLink to='/selection' style={({isActive}) => {
          return {
            color: isActive && 'red'
          }
        }}>
          <li>Selection</li>
        </NavLink>
      </ul>
    </nav>
            </div>

        </div>



    </nav>
  )
}

export default HeaderNav;
